function difficultyLoader() {
  if(localStorage.getItem("difficulty") === "normal") {
  document.getElementById("normalDif").classList.add("active");
  document.getElementById("hardDif").classList.remove("active");
  document.getElementById("hellDif").classList.remove("active");
  }else
  if(localStorage.getItem("difficulty") === "hard") {
  document.getElementById("normalDif").classList.remove("active");
  document.getElementById("hardDif").classList.add("active");
  document.getElementById("hellDif").classList.remove("active");
  }else
  if(localStorage.getItem("difficulty") === "hell") {
  document.getElementById("normalDif").classList.remove("active");
  document.getElementById("hardDif").classList.remove("active");
  document.getElementById("hellDif").classList.add("active");
  }
}
difficultyLoader();
